description:
The updated version 3.6.5 of Panic&amp;#039;s Transmit.

&quot;column view. idisk. sidebar. ftp/ssl. search. zooming. tabs.
transmit 3 takes mac os x ftp to the next level. again&quot;

Some changes:
- Fixed a crash with &quot;stacked&quot; operations, such as quickly changing directory after making a new connection
- S3: We now support creation of buckets on European S3 servers, which is likely both faster and cheaper for European users
- S3: Transmit now uses the REST interface, rather than the deprecated SOAP interface
- S3: Fixed a bug that prevented S3 folder creation on Panther (10.3) systems
- FTP-SSL: If SSLv23 connection fails, Transmit will fall back to TLSv1
- Transmit no longer always uploads in binary mode on certain configurations of ProFTPD

